const URL = "http://localhost:8080/musely-takehome/rest/users";

class UserService {
  getUsers() {
    return fetch(URL + "/all").then(response => response.json());
  }

  createUser(user) {
    return fetch(URL + "/create", {
      method: "POST",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify(user)
    }).then(response => response.json());
  }

  getUserById(id) {
    return fetch(URL + "/" + id).then(response => response.json());
  }

  updateUserCredit(id, credit) {
    return fetch(URL + "/" + id + "/credit", {
      method: "PUT",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({ credit })
    }).then(response => response.json());
  }

  updateUserDebit(id, debit) {
    return fetch(URL + "/" + id + "/debit", {
      method: "PUT",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({ debit })
    }).then(response => response.json());
  }
}

export default new UserService();
